import { departments } from './vendor/constants';
import Section from './Section';

function Main () {
  return(
    <div className='page'>
      <div className='content'>
        {departments.map((department) => {
          return (
            <Section card={department}/>
          )
        })}
      </div>
   </div>
  )
}

export default Main
